@givergete OUTRA COISA PELO CARGO POLÍTICO QUE ELA PLEITEOU , ELA TEM POR OBRIGAÇÃO NO MÍNIMO ENTENDER O BÁSICO PARA CONDICIONAR LEIS BÁSICAS PARA O MUNICÍPIO DELA .
OUTRA COISA COM TODA CERTEZA AS MÃES ATÍPICAS DE ARCO VERDE SÃO MUNÍCIPES TAMBÉM E ELA É CAPITALIZADA PELO MUNICÍPIO PARA SABER E CRIAR LEIS .
O MÍNIMO….
